    true,nt"url": null,nt"notes": "<p>This is a Public Use File for Prescription
    Drug Events drawn from the 2008 Beneficiary Summary File of Medicare beneficiaries
    enrolled during the calendar year 2008, and their associated Medicare claims. The
    most important aspects of this file are as follows, 1. 5 percent simple random sample
    drawn without replacement from 100 percent 2008 Beneficiary Summary File. 2. This
    sample is disjoint from the existing 5 percent CMS Research Sample and the other
    2008 PUFs. 3. Sample contained 2,392,893 unique beneficiaries of which 1,265,691
    had at least one PDE. There were 51,905,367 PDE in the initial sample file.</p>n",nt"license_title":
